@hmbbrewingco @halfmoonbaywinery @stillhouseusa @mcfishy_industries @norushstudios @mavericksfestival

It’s all fun and games until… 

Nobody is impervious to the occasional miscalculation or error in judgement.  Most of the time you get away without consequence…Until you don’t. 
Lucky to have walked away from this one. 

My utmost respect and gratitude to the friends, lifeguards, and dog who rushed to make sure I was okay and help me out of the water and to the entire Puerto family for the love and hospitality. 🙏🏽 🇲🇽. 

